import{_ as a,c as t,o as i,d as r}from"./app.6898ed50.js";const u=JSON.parse('{"title":"DT angiografi","description":"","frontmatter":{},"headers":[{"level":2,"title":"DT angiografi TIA-utredning","slug":"dt-angiografi-tia-utredning"},{"level":2,"title":"DT angiografi halsk\xE4rl","slug":"dt-angiografi-halskarl"},{"level":2,"title":"DT hj\xE4rnangiografi","slug":"dt-hjarnangiografi"},{"level":2,"title":"Fr\xE5gest\xE4llningar","slug":"fragestallningar"}],"relativePath":"dt-angiografi.md","lastUpdated":1662732875000}'),l={name:"dt-angiografi.md"},e=r('<h1 id="dt-angiografi" tabindex="-1">DT angiografi <a class="header-anchor" href="#dt-angiografi" aria-hidden="true">#</a></h1><p>Cerebrovaskul\xE4ra angiografier g\xF6rs med kontrast i art\xE4rfas, till skillnad fr\xE5n DT hj\xE4rna med kontrast som g\xF6rs med kontrast i parenkymfas. Det finns olika protokoll p\xE5 S\xF6dersjukhuset: <a href="#dt-angiografi-tia-utredning">DT angiografi TIA-utredning</a>, <a href="#dt-angiografi-halskarl">DT angiografi halsk\xE4rl</a> och <a href="#dt-hjarnangiografi">DT hj\xE4rnangiografi</a>.</p><div class="info custom-block"><p class="custom-block-title">Unders\xF6kta blodk\xE4rl:</p><ul><li>Arteria carotis communis (vid DT angiografi TIA-utredning och DT strokelarm)</li><li>Arteria carotis internae</li><li>Arteria vertebralis</li><li>Arteria basilaris</li><li>Intracerebrala art\xE4rer och proximala avg\xE5ngar</li></ul></div><div class="warning custom-block"><p class="custom-block-title">Indikation</p><ul><li>Ischemisk stroke</li><li>TIA (utredning av karotisstenos)</li><li>Subaraknoidalbl\xF6dning</li><li>Hj\xE4rnaneurysm</li></ul></div><div class="tip custom-block"><p class="custom-block-title">Normalfynd</p><p>Inga plack, stenoser eller ocklusioner. Ingen dissektion eller aneurysm. \xD6ppetst\xE5ende blodk\xE4rl.</p></div><h2 id="dt-angiografi-tia-utredning" tabindex="-1">DT angiografi TIA-utredning <a class="header-anchor" href="#dt-angiografi-tia-utredning" aria-hidden="true">#</a></h2><ul><li>Omfattar omr\xE5det fr\xE5n arcus aorta upp till vertex.</li><li>Indikation strokelarm och \xF6vrig stroke-/TIA-utredning.</li></ul><h2 id="dt-angiografi-halskarl" tabindex="-1">DT angiografi halsk\xE4rl <a class="header-anchor" href="#dt-angiografi-halskarl" aria-hidden="true">#</a></h2><ul><li>Omfattar C6-niv\xE5 till vertex.</li><li>Indikation patient\xE5lder &lt;45 \xE5r och dissektionsutredning.</li></ul><h2 id="dt-hjarnangiografi" tabindex="-1">DT hj\xE4rnangiografi <a class="header-anchor" href="#dt-hjarnangiografi" aria-hidden="true">#</a></h2><ul><li>Omfattar C2-niv\xE5 till vertex, minst kontrastm\xE4ngd.</li><li>Indikation aneurysmutredning.</li></ul><h2 id="fragestallningar" tabindex="-1">Fr\xE5gest\xE4llningar <a class="header-anchor" href="#fragestallningar" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">Exempel</p><ol><li>Stenos?</li><li>Ocklusion?</li><li>Plack?</li><li>Dissektion?</li><li>Aneurysm?</li><li>K\xE4rlanomali?</li></ol></div><table><thead><tr><th>Fr\xE5gest\xE4llning</th><th>Tillst\xE5nd</th><th>Kommentar</th></tr></thead><tbody><tr><td><b>Stenos?</b></td><td>- Karotisstenos<br>- Basilarisstenos<br>- Intracerebrala art\xE4rer</td><td>Stenosgrad i % anger graden av f\xF6rtr\xE4ngning pga plack/ateroskleros.</td></tr><tr><td><b>Ocklusion?</b></td><td>- Trombos (ex. basilaristrombos)<br>- Emboli</td><td>Vid misstanke om sinustrombos ska dock <a href="./dt-venografi-sinustrombos.html">DT venografi</a> best\xE4llas.</td></tr><tr><td><b>Plack?</b></td><td>Ateroskleros</td><td><u>Fynd:</u><br>- F\xF6rkalkade plack<br>- Icke-f\xF6rkalkade plack<br>- Mjukt plack<br>- Emboliserat plack<br>- Kaliberv\xE4xling - oftast tecken till ateroskleros</td></tr><tr><td><b>Dissektion?</b></td><td>- Vertebralisdissektion<br>- Karotisdissektion</td><td></td></tr><tr><td><b>Aneurysm?</b></td><td></td><td>Dolioektasi = vidgad/f\xF6rl\xE4ngt blodk\xE4rl, f\xF6rsvagning av k\xE4rlv\xE4ggen</td></tr><tr><td><b>K\xE4rlanomali?</b></td><td>AV-missbildning</td><td></td></tr></tbody></table>',14),n=[e];function s(o,d,g,c,k,h){return i(),t("div",null,n)}const b=a(l,[["render",s]]);export{u as __pageData,b as default};
